import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

export default function Navbar() {
  const navigate = useNavigate();

  return (
    <header className="w-full z-50">
      <div className="max-w-6xl mx-auto px-6 py-4 flex items-center justify-between bg-white shadow-sm gloss-card">
        <motion.div
          initial={{ x: -20, opacity: 0 }}
          animate={{ x: 0, opacity: 1 }}
          transition={{ duration: 0.5 }}
          className="flex items-center gap-3 cursor-pointer"
          onClick={() => navigate("/")}
        >
          <div className="w-10 h-10 rounded-full bg-gradient-to-r from-hc-400 to-hc-600 flex items-center justify-center text-white font-bold">
            HC
          </div>
          <div className="text-lg font-bold text-red-700">HealthChain</div>
        </motion.div>

        <nav className="flex items-center gap-6">
          <Link className="text-gray-700 hover:text-red-600" to="/">Home</Link>
          <Link className="text-gray-700 hover:text-red-600" to="/about">About</Link>
          <Link className="text-gray-700 hover:text-red-600" to="/select-role">Sign In</Link>
        </nav>
      </div>
    </header>
  );
}
